import React, { Component } from "react";
import { Grid, Cell } from "react-mdl";

class Contact extends Component {
  render() {
    return (
      <div className="contact-info">
        <Grid className="contact-grid">
          <Cell col={6}>
            <h2>Carolene Wilson-Grizzle</h2>
            <img
              src={require("../image/contact_img.jpg")}
              alt="Contact Img"
              className="contact_img"
              style={{ height: "250px" }}
            />
            <p>
            Resourceful Back-End Web Developer certified in Full Stack Web Development from the University of
				Connecticut. Credited with newly acquired skills in HTML, CSS, jQuery, AJAX, Client Storage, Nodejs,
				Python, and JavaScript. Complemented with a Bachelor of Science degree in Business Administration and a
				Postgraduate Certificate in Project Management. Challenged as a situational leader whom is
				self-motivated, performance orientated, strategic thinker, critical analyses with charismatic
				interpersonal skills
            </p>
          </Cell>
          <Cell col={6}>Half way</Cell>
        </Grid>
      </div>
    );
  }
}

export default Contact;
